function Menu(props){
  if(props.loginState == false){
    return (
      <div className="visitorMenu">
        <span>로그인</span>
        <span>회원가입</span>
      </div>
    )
  }
  return (
    <div className="visitorMenu">
      <span>나의 만다라트</span>
      <span>회원명</span>
    </div>
  )
}

export default Menu;
